issue.body:
### Why this update?
According to the NPM [documentation](https://www.npmjs.com/package/omelette). The library should be able to make the tree as so:
```json
{
  "how":{
    "much":{
      "is":{
        "this":[
          "car"
        ],
        "that":[
          "house"
        ]
      }
    },
    "are":[
      "you"
    ],
    "many":[
      "cars",
      "houses"
    ]
  }
}
```

Where it only now can be an object of keys where the values are arrays of strings. By changing the type to object it allows the editor to accept this new form for tree structure.

